(()=>{return(t,s)=>{const e={less:-1,equal:0,greater:1,incomparable:NaN};class n{constructor(t){this.parts=t.split(".").map(t=>parseInt(t));this.versionString=t}compareTo(t){for(let s=0;s<this.parts.length;++s){if(t.parts.length===s){return e.greater}if(this.parts[s]===t.parts[s]){continue}if(this.parts[s]>t.parts[s]){return e.greater}return e.less}if(this.parts.length!==t.parts.length){return e.less}return e.equal}greaterThan(t){return this.compareTo(t)===e.greater}lessThan(t){return this.compareTo(t)===e.less}equals(t){return this.compareTo(t)===e.equal}}const i=new n(s.data.latestVersion.text);const a=new n(t.currentVersion);if(i.greaterThan(a)){return{settingsWidget:{after:()=>$(".gui-settings-content"),content:`<div class="gui-settings-footer${t.blurSettingsPanel?" blur":""}">\n                            <span class="gui-settings-label">新版本${i.versionString}已发布.</span>\n                            <a href="${t.latestVersionLink}">\n                                <button\n                                    class="gui-settings-button"\n                                    id="new-version-update">\n                                    更新\n                                </button>\n                            </a>\n                            <a target="blank"  href="https://github.com/the1812/Bilibili-Evolved/releases">\n                                <button\n                                    class="gui-settings-button">\n                                    详细信息\n                                </button>\n                            </a>\n                        </div>`,success:()=>{SpinQuery.any(()=>$(".gui-settings"),t=>{t.addClass("gui-settings-notification")});const s=`新版本${i.versionString}已发布.  <a class="link" href="${t.latestVersionLink}">更新</a><a class="link" target="_blank"   href="https://github.com/the1812/Bilibili-Evolved/releases">详细信息</a>`;Toast.info(s,"检查更新")}},widget:{content:`\n\n                    `,success:async()=>{const s=await SpinQuery.any(()=>$(".gui-settings"));s.addClass("gui-settings-notification");const e=`新版本${i.versionString}已发布.  <a class="link" href="${t.latestVersionLink}">更新</a><a class="link" target="_blank"   href="https://github.com/the1812/Bilibili-Evolved/releases">详细信息</a>`;Toast.info(e,"检查更新")}}}}}})();